	public void test_myAtoi() throws Exception{
		LeetCodeSolution ls = new LeetCodeSolution();
		System.out.println(ls.myAtoi2("-2147483647"));
		System.out.println(Integer.MAX_VALUE);
		System.out.println((Integer.MAX_VALUE - (int)('8' - '0'))/10);
		System.out.println(ls.myAtoi2("-2147483648"));
		Assert.assertEquals(-2147483647, ls.myAtoi2("-2147483647"));
        Assert.assertEquals(-2147483648, ls.myAtoi2("-2147483649"));
		Assert.assertEquals(123, ls.myAtoi2("123 456"));
		Assert.assertEquals(10, ls.myAtoi2("   010"));
		Assert.assertEquals(-12, ls.myAtoi2("  -0012a42"));
		Assert.assertEquals(0, ls.myAtoi2("a0000111111111-1111111111111"));
		Assert.assertEquals(11, ls.myAtoi2("000011aad1"));
	}
	
